class App extends React.Component {

  state = {
    emailInput: '',
    senhaInput: '',
  }

  onChangeInputEmailInput = (event) => {
    this.setState({ emailInput: event.target.value })
  }

  onChangeInputSenhaInput = (event) => {
    this.setState({ senhaInput: event.target.value })
  }

  onSubmitForm = () => {
    this.setState({})
  }

  render() {
    return (
      <main>
        <form onSubmit={this.onSubmitForm}>
          <label>
            <input
              email="Email"
              placeholder="Insira seu email"
              value={this.state.emailInput}
              onChange={this.onChangeEmailInput}
            />
          </label>

          <label>
            <input
              name="Senha"
              placeholder="Digite sua senha"
              value={this.state.emailInput}
              onChange={this.onChangeEmailInput}
            />
          </label>

          <button>Enviar</button>
        </form>
      </main>
        );
  }
}


        export default App;
